      <header className="App-header"></header>
      <WishlistList></WishlistList>
    </div>

  );
}

export default App;
App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Wishlist />}>
          <Route index element={<Wishlist />} />
          <Route path="wishlist/:id" element={<ItemList />} />
          <Route path="*" element={<Wishlist />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
};
